import Sidebar from "../../core/components/core-sidebar";
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
import { ReactComponent as FUBULogoSmall } from '../../assets/fubu_logo_small.svg'
import Grid from '@material-ui/core/Grid';
import theme from '../../theme';
import { Typography } from '@material-ui/core';
import Button from '@material-ui/core/Button';
import Emoji from '../../core/components/core-emoji';


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',

    },
    logo: {
        paddingTop: theme.spacing(14),
        paddingBottom: theme.spacing(6),
        textAlign: 'center',
        marginLeft: 'auto',
        marginRight: 'auto',
        display: 'block',
    },
    bigButtons: {
        width: '420px',
        height: '77px',
        fontWeight: 400,
        marginTop: '15px',
        marginBottom: '25px',
        fontSize: '33px',
        borderRadius: '8px',
        marginLeft: 'auto',
        marginRight: 'auto',
        display: 'block',
        borderColor: '#FFB9AE',
        '&:hover': {
            backgroundColor: '#FFB9AE',
        },
    },
    logout: {
        backgroundColor: theme.palette.error.main,
        width: '148px',
        height: '46px',
        color: "#fff",
        fontSize: '24px',
        boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.25)',
        '&:hover': {
            backgroundColor: theme.palette.error.dark,
        },
    },
    logoutRow: {
        marginTop: '32px',
        marginRight: '50px',
        display: 'flex',
        justifyContent: 'flex-end',
        height: '%50',

    },
    text: {
        display: 'flex',
        textAlign: 'center',
        justifyContent: 'center',
    }
}));



function DashOrg() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container xs={12} className={classes.root}>
            <Grid container xs={2}>
            <Sidebar></Sidebar>
                </Grid>
            <Grid container xs={10}>
                <Grid item  xs={12} className={classes.logoutRow}>
                <Button className={classes.logout} variant="contained" size="large" color="error">Logout</Button>
                </Grid>
                <Grid className={classes.text} item xs={12}>
                <Grid item xs={6}>
                <Typography variant="h1"> Good afternoon, (user first name here)!</Typography>
